import StatusDot from  '../shared/StatusDot'
export default function Users({usersData}) {
    const users = usersData || [{
        first_name: 'First',
        last_name: 'Last',
        role: 'Project Lead',
        avatar: 'http://placekitten.com/200/300',
        city: 'New York'
    }]
    const CardGenerator = () => {

        const Card = ({user, id}) => {
            return (
                <div className='w-full overflow-x-scroll pl-4 pt-4'>
                    <img src={users[id].avatar} className='w-32 h-32 inline-block rounded-full shadow'/>
                    <div className="text-left w-24 leading-tight">
                        <h3 className="text-lg font-f1">{users[id].first_name+' '+users[id].last_name}</h3>
                        <p className='text-xs font-f1 font-thin'>{users[id].role}</p>
                        <p className='text-xs font-f1 font-thin'>{users[id].city}</p>
                        <div className='font-thin text-xs font-c1 flex items-center'>
                            <p>Online</p>
                            <StatusDot color='green-400'/>
                        </div>
                    </div>
                </div>
            )
        }
        const cards = users.map((user, i) => (<Card user={user} id={i} />))
        return cards

    }
    return(
        <div className="flex flex-no-wrap overflow-x-scroll">
            <CardGenerator />
        </div>
    )
}
